import React, {Component} from 'react';
import Product from './Product';

class Products extends Component {
	render() {
		let products = this.props.products.map((product) => {
			return (
				<Product
					product={product}
				/>
			);
		});

		return (
			<div className="Product-list">
				{products}
			</div>
		);
	}
}

export default Products;
